import Login from "./login.component"
import React from "react"
import Register from "./register.component"

export const AuthRoutes = [
	{
		path: "auth",
		children: [
			{
				path: "/",
				element: <Register />,
			},
			{
				path: "/register",
				element: <Register />,
			},
			{
				path: "/login",
				element: <Login />,
			},
		],
	},
]
